import React, { useEffect, Fragment } from "react";
import { useSelector, useDispatch } from "react-redux";
import { Link } from "react-router-dom";

import { orderCompleted } from "../store/action.js";

import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";

const useStyles = makeStyles((theme) => ({
  button: {
    margin: theme.spacing(1),
    backgroundColor: "#9469dd",
    margin: "0px",
  },
}));

export function CompleteOrder() {
  const dispatch = useDispatch();
  const classes = useStyles();
  const { mediaType, mediaLink, orderDetails } = useSelector(
    (state) => state.mediaModule
  );

  const currOreder = {
    mediaType,
    mediaLink,
    orderDetails,
  };

  useEffect(() => {
    dispatch(orderCompleted(currOreder));
  }, []);

  return (
    <Fragment>
      <div className="complete-order flex column">
        <h3>-פרטי הזמנה</h3>
        <h4>{currOreder.mediaType.label} :סוג</h4>
        <p className="link-to-order">:לינק</p>
        <span>{currOreder.mediaLink}</span>
        <h4>{currOreder.orderDetails.fullName} :שם מלא</h4>
        <h4>{currOreder.orderDetails.phoneNumber} :טלפון</h4>
        <h4>{currOreder.orderDetails.email} :אימייל</h4>
        <h3>-כתובת למשלוח</h3>
        <h4>{currOreder.orderDetails.address.city} :עיר</h4>
        <h4>{currOreder.orderDetails.address.street} :רחוב</h4>
        <h4>{currOreder.orderDetails.address.number} :מס בית</h4>
      </div>
      <div>
        <Button variant="contained" className={classes.button} disableElevation>
          <Link to="/payment"> 〱 מעבר לתשלום</Link>
        </Button>
      </div>
    </Fragment>
  );
}
